#include <stdio.h>
#include <stdlib.h>

const int MOD = 1000000007;

long long modPow(long long base, int exp, int mod) {
    long long result = 1;
    while (exp > 0) {
        if (exp % 2 == 1) {
            result = (result * base) % mod;
        }
        base = (base * base) % mod;
        exp /= 2;
    }
    return result;
}

long long modInverse(long long n, int mod) {
    return modPow(n, mod - 2, mod);
}

long long modFact(int n, int mod) {
    long long result = 1;
    for (int i = 1; i <= n; i++) {
        result = (result * i) % mod;
    }
    return result;
}

int stringCount(int n) {
    if (n < 4) return 0;

    long long total = modFact(n, MOD);
    long long excludeLeet = (modFact(n - 4, MOD) * modPow(24, MOD - 2, MOD)) % MOD; // 24 = 4! for "leet"

    long long badStrings = (excludeLeet * modPow(25, n - 4, MOD)) % MOD; // 25 choices for each of the other positions
    long long goodStrings = (total - badStrings + MOD) % MOD;

    return (int)goodStrings;
}
